import React from "react";
import Codebox from "../../../component /Codebox/Codebox";
import styles from "./Three.module.scss";
import app_styles from "../../../app.module.scss";
const Three = () => {
  return (
    <div className={styles.codebox}>
      <p className={app_styles.p}>*非React寫法</p>

      <h1 className={app_styles.h1}>Three 安裝</h1>
      <h2 className={app_styles.h2}>npm</h2>
      <Codebox text="npm install --save Three" />
      <h2 className={app_styles.h2}>yarn</h2>
      <Codebox text="yarn add Three" />
      <h1 className={app_styles.h1}>Three </h1>
      <Codebox text='import Three from "Three"' />
    </div>
  );
};

export default Three;
